#include <iostream>
#include <string>
#include <sstream>

using namespace std;

void main() {
	string input = "    ";
	stringstream ss(input);
	string token;
	string result = "";

	char grid[5][5] = { { '0', '0', '1', '0', '0' },{ '0', '2', '3', '4', '0' },{ '5', '6', '7', '8', '9' },{ '0', 'A', 'B', 'C', '0' },{ '0', '0', 'D', '0', '0' } };
	int row = 2;
	int column = 0;
	while (getline(ss, token, ' ')) {
		std::cout << token << endl;
		for (string::iterator it = token.begin(); it < token.end(); it++) {
			switch (*it) {
			case 'U':
				if (row != 0 && grid[row - 1][column] != '0')
					row -= 1;
				break;
			case 'R':
				if (column != 4 && grid[row][column + 1] != '0')
					column += 1;
				break;
			case 'D':
				if (row != 4 && grid[row + 1][column] != '0')
					row += 1;
				break;
			case 'L':
				if (column != 0 && grid[row][column - 1] != '0')
					column -= 1;
				break;
			}

		}
		std::cout << endl;
		result += grid[row][column];
	}
	std::cout << result << endl;
}